        <h3>Deploy PowerBI Report</h3>
        <p>A PowerBI report has been created that allows you to view the Cognitive Services skills enrichments. These enrichments are sent to Azure Table Storage via the KnowledgeStore feature. You simply need to download the PowerBI report, modify the data source and then refresh the data sources. You will then be able to see all the enhancements your skill pipeline has added to your Azure Search index.</p>
        <p>A sample of the report can be downloaded from <a href=""https://msit.powerbi.com/groups/90835fa6-4c77-4816-ab2b-9b3f9629615e/reports/d23bf354-ad0f-4326-801d-a41c88b2a049/ReportSection945e601b00077ec100a6"">here</a></p>
        <p>You can download the Power BI PBIX file from <a href=""https://cognitivesearchcontent.blob.core.windows.net/packages/PowerBI Report.pbix"">here</a>.</p>
        <div>
            <p>Once downloaded, modify the data source using the following steps:</p>

            <ol>
    ");
