                <li>Click Edit Queries dropdown and choose ""Data source settings""</li>
                <li>Select the first data source, then click ""Change source""</li>
                <li>Enter the name of the storage account</li>
                <li>Click OK</li>
                <li>Click ""Edit permissions""</li>
                <li>Click Edit under Credentials</li>
                <li>Update the account key with the primary or secondary key</li>
